import React from "react";
import {ListGroup, ListGroupItem, Table} from 'reactstrap';


const WorkoutWeekTable = ({workouts}) => {

    const tableStyle = {
        height: '100%',
        marginTop: '50px',
        tableLayout: 'fixed'
    };

    const tableDataStyleHeaders = {
        width: '10%',
        fontSize: '10px',
        fontWeight: 'bold'
    };

    const tableDataStyleWorkout = {
        fontSize: '10px',
    };

    return (
        <Table bordered responsive style={tableStyle}>
            <thead>
            <tr>
                <th style={tableDataStyleHeaders}>Mo</th>
                <th style={tableDataStyleHeaders}>Tu</th>
                <th style={tableDataStyleHeaders}>We</th>
                <th style={tableDataStyleHeaders}>Th</th>
                <th style={tableDataStyleHeaders}>Fr</th>
                <th style={tableDataStyleHeaders}>Sa</th>
                <th style={tableDataStyleHeaders}>Su</th>
            </tr>
            </thead>
            <tbody>
            <tr>
                {workouts.map(workout => <td style={tableDataStyleHeaders} key={ workout.id }>{workout.name}</td>)}
            </tr>
            <tr style={{"height": "400px"}}>
                {workouts.map(workout =>
                    <td key={ workout.id }>
                        {workout.exercises.map(exercise => (
                            <ListGroup variant="flush">
                                <ListGroupItem style={tableDataStyleWorkout}>
                                    {exercise.name}
                                </ListGroupItem>
                            </ListGroup>
                        ))}
                    </td>)}
            </tr>
            </tbody>
        </Table>

    )
}

export default WorkoutWeekTable;


